$.XP=function(){var s="worldwidewebhunt.com",r=t.s
return A.a([A.a(["In Canada, the canoe has long been associated with the fur trade and the romantic figure of the voyageur."],r),A.a(["The maple leaf is one of the most recognizable symbols of Canada and is featured on the national flag."],r),A.a(["Inuit live throughout most of Northern Canada in the territory of Nunavut."],r),A.a(["The official tartan for Canada as a whole is known as the Maple leaf tartan."],r),A.a(["Igloo comes from the Inkuktitut word \u201ciglu\u201d meaning house."],r),A.a(["Hoser is a slang word for a Canadian of limited intelligence."],r),A.a(["Canada produces 71% of the world's maple syrup, 91% of it coming from Quebec."],r),A.a(["Canadian bacon comes from the loin of the pig instead of the side or belly."],r),A.a(["Canadians apologize so much, Canada passed the Apology Act in 2009."],r),A.a(["There are more than 33 species of whale that live in Canada's oceans."],r),A.a(["One of Canada's most famous nicknames is the Great White North."],r),A.a(["This word is a humorous (though incorrect) take on the Canadian accent saying the word \u201cabout\u201d"],r),A.a(["Banff was declared a UNESCO World Heritage Site in 1984."],r),A.a(["About 28 million litres of water travel down Niagara Falls every second."],r),A.a(["The word totem comes from the Algonquian word \u201codoodem\u201d meaning \u201chis kinship group\u201d."],r),A.a(["Queen Elizabeth II has been Canada's monarch for over 70 years."],r),A.a(["Loons have beautiful, crimson red eyes, but this is only during mating season."],r),A.a(["The M\xe9tis invented the york boat, used by the Hudson's Bay Company to carry furs and trade goods along waterways."],r),A.a(["Toque (or tuque) is the official name for a winter hat in Canada!"],r),A.a(["The 202 km of Rideau Canal with 47 locks is the oldest, continuously operated canal system in North America."],r),A.a(["Canada has the 3rd largest oil reserves in the world and is the 4th largest oil producer and exporter."],r),A.a(["A subspecies known as \u201cgiant\u201d Canada geese are the largest geese in the world."],r),A.a(["Canada has more lakes than the rest of the world combined! Almost 9% of Canada's total surface area is covered by freshwater."],r),A.a(["As of 2019, there were 47 Crown corporations in Canada, including CBC, Canada Post, VIA Rail, the Royal Canadian Mint, and the Bank of Canada."],r),A.a(["PEI produces more potatoes for Canada than any other province and produces 2.5 billion lbs (1.1 million tonnes) per year globally!"],r),A.a(["Roots Canada opened its first store in 1973 selling footwear, and started using the beaver logo in 1985 with the launch of their athletic brand."],r),A.a(["On February 10, 1999, Tahtsa Lake, British Columbia got hit with 145 cm (4'9\") of snow in ONE day!"],r),A.a(["Yukon is home to Mount Logan, Canada's tallest mountain (5959 m) and the 2nd highest peak in North America."],r),A.a(["Canada is home to about 16,000 polar bears, which is approximately two-thirds of the world's total estimated population."],r),A.a(["Bison are North America's largest land animal, with bulls weighing up to 2000 lbs (900 kg) and cows up to 1000 lbs (450 kg)."],r),A.a(["Toronto's CN Tower held the record for the world's tallest free-standing structure for 32 years, from 1975 until 2007."],r),A.a(["Roughly half of the world's Grizzly Bears (a Brown Bear subspecies) live in Canada, mostly in BC."],r),A.a(["One of the NHL's founding teams, the Toronto Maple Leafs have won 13 Stanley Cups, the most recent being in 1967."],r),A.a(["Close to half of all Canadian wheat is grown in Saskatchewan, followed by Alberta and Manitoba."],r),A.a(["There\u2019s a whopping 48 National Parks and over one thousand Provincial and Territorial parks in the Great White North!"],r),A.a(["Kayaks were originally designed for hunting and fishing. In fact, the word kayak means \u201chunter's boat\u201d, and came from \u201cqajaq\u201d or \u201cqayarq\u201d, a Greenlandic Inuit word."],r),A.a(["The moose is the largest species of deer in the world. The average weight of a fully grown male moose (a bull) is 1500 lbs (680 kg)!"],r),A.a(["Since 2016, the month of June has been declared Pride Month in Canada to celebrate the LGBTQ2+ community."],r),A.a(["The Rocky Mountains, also known as the Rockies, are the largest mountain system in North America!"],r),A.a(["Scoff is Newfoundland slang for a big feed, typically Jiggs dinner but could be any large, satisfying meal."],r),A.a(["Cabin is another name for a cottage, and Canada has no shortage of weekend getaway spots!"],r),A.a(["Canadians spent $9.2 billion on beer in 2020 ($325 per adult), which equates to 2.3 billion litres of beer."],r),A.a(["Originally created by the Inuit to keep warm in the Canadian Arctic, the first parkas were made from whale, seal or caribou skin and often coated with fish oil for waterproofing."],r),A.a(["In the 2020/21 season, there were 2,860 indoor and 5,000 outdoor ice hockey rinks located in Canada according to the International Ice Hockey Federation."],r),A.a(["Canadians consumed over 240,000 metric tonnes of frozen fries in 2019."],r),A.a(["Canada has the longest coastline in the world, measuring 243,042 km!"],r),A.a(["The Order of Canada is how our country honours people who make extraordinary contributions to the nation."],r),A.a(["In 1876, Scottish-born inventor Alexander Graham Bell patented the first practical telephone, a concept that he conceived in Brantford, Ontario."],r),A.a(["The white birch is the most widely distributed of native birch trees, and grows in every region of Canada. The bark has long been used for making canoes and ornaments."],r),A.a(["Canada is home to numerous ports, but the Port of Vancouver is Canada's largest port, and is the most diversified port in North America."],r),A.a(["The Dairy Farmers of Canada logo guarantees a product is made with 100% Canadian milk and milk ingredients, and is free of antibiotics."],r),A.a(["Skate Canada is the oldest and largest figure skating organization in the world."],r),A.a(["In 2020, roughly 1 out of every 9 Canadian jobs was in the agriculture and agri-food sector."],r),A.a(["Annually, Canada\u2019s Rivers discharge 7% of the world\u2019s renewable water supply at a flow rate per second more than four times that of Niagara Falls."],r),A.a(["Canada's official national sports are ice hockey (winter) and lacrosse (summer)."],r),A.a(["The Globe and Mail newspaper originated from two competing newspapers, \u201cThe Globe\u201d and \u201cThe Mail and Empire\u201d."],r),A.a(["Poutine (fries topped with cheese curds and gravy) is popular all over Canada and as such it is considered the country's national dish."],r),A.a(["Four species of foxes live in Canada: arctic, swift, grey, and red being the most common. The grey fox is one of only 2 members of the dog family that can climb trees."],r),A.a(["Canada is the world\u2019s largest grower and exporter of flax seed, canola, oats, mustard seeds, pulses (peas, beans, and lentils) and durum wheat."],r),A.a(["Over 5.7 million Canadian adults camp each year and the camping industry contributes a total of $4.7 billion annually to Canada's economy."],r),A.a(["The Calgary Stampede, Canada's largest rodeo, is billed as \u201cThe Greatest Outdoor Show on Earth\u201d. It is held every July and turns 110 years old in 2022."],r),A.a(["Canada\u2019s three biggest trading partners are the United States, the European Union and China. Goods and services trade with the US totaled over $800 billion in 2021."],r),A.a(["Canada consistently ranks in the top 10 most peaceful countries in the world according to the Global Peace Index (GPI). The Peace Tower also forms the centrepiece of the Canadian parliament buildings."],r),A.a(["In 2020, Canada produced 60 minerals and metals at almost 200 mines, and the value of Canada's mineral production reached $43.8 billion."],r),A.a(["The shores of Canada's 52,455 islands are a big part of what makes the country's coastline the longest in the world."],r),A.a(["Canada has the world\u2019s largest stock of standing western redcedar trees. The western redcedar is the arboreal emblem of the province of British Columbia."],r),A.a(["With a landmass of almost 10 million square kilometres, Canada is the second-largest country in the world."],r),A.a(["The Brier is the annual Canadian men's curling championship that has been held since 1927. Team Gushue won the 2022 Brier, their fourth championship in six years."],r),A.a(["The highest tides in the world can be found in Canada at the Bay of Fundy, which separates New Brunswick from Nova Scotia."],r),A.a(["A klick is a military term used to denote a distance of one kilometre. It is commonly used in Canada when referring to distance or speed."],r),A.a(["The Canadian Tuxedo is an outfit consisting of a denim jacket or jean shirt worn with denim jeans, or denim-on-denim. The term originated in 1951 after Bing Crosby was refused entry to a Vancouver hotel wearing double denim."],r),A.a(["The most famous ship in Canadian history, the Bluenose, was both a fishing and racing vessel in the 1920s and 1930s. The Nova Scotia schooner achieved immortality when its image was engraved onto the Canadian dime."],r),A.a(["From the last Friday in October to Remembrance Day, millions of Canadians wear a poppy as a visual pledge to never forget those who sacrificed for our freedom."],r),A.a(["The Supreme Court of Canada is the highest court in the judicial system of Canada. It comprises nine justices, whose decisions are the ultimate application of Canadian law."],r),A.a(["A beaver home is called a lodge. Beavers live in wetland habitats along lakes and rivers and are some of the best architects in the wild. Some even call them the original Canadian lumberjacks!"],r),A.a(["With marine waters spanning its west, north, and east coasts, Canada is an ocean nation. Canadians are influenced in many ways by the Pacific, Arctic, and Atlantic Oceans. Celebrate World Oceans Day on June 8th!"],r),A.a(["Buoyed by its inclusion in the 2016 Olympic Games, Rugby is one of the fastest growing team sports in Canada, particularly in youth and women."],r),A.a(["Canada officially uses the metric system of measurement, and metre is the standard spelling of the metric unit for length."],r),A.a(["Elders are respected individuals who play key roles in Indigenous communities. They are important knowledge keepers, and they also help to ensure cultural continuity."],r),A.a(["Canada's contributions to space exploration include one of Canada\u2019s most celebrated and iconic technological advances: The Canadarm - a remote-controlled robotic arm used to help build and maintain the International Space Station (ISS)."],r),A.a(["On April 30, 2002, a bill was passed into law by the Canadian Government making the Canadian horse an official symbol of Canada. The Canadian horse is known for its great strength and endurance, resilience, intelligence and good temper."],r),A.a(["Newfoundland, Canada is widely considered one of the foggiest places on Earth. On average, Newfoundland experiences over 200 foggy days every year."],r),A.a(["Lottery & gambling winnings in Canada are treated as windfalls and are not subject to Canadian income tax. Turns out taxes aren't always certain after all!"],r),A.a(["Canada has a large and well-developed railway system that includes transcontinental freight train services by Canadian National (CN) and Canadian Pacific (CP), and nationwide passenger train services by Via Rail."],r),A.a(["The Canadian music industry is the sixth-largest in the world, producing internationally renowned composers, musicians and ensembles. O Canada!"],r),A.a(["Celebrated annually on November 21st, National Red Mitten Day encourages Canadians to display their patriotism in support of Canadian athletes! Red mittens represent the pride, generosity, and excellence of every Canadian."],r),A.a(["The grain sector is a key driver of Canada's economic growth, exporting 26.4 million tonnes of wheat in 2020-21 and over $25 billion in exports sales."],r),A.a(["In the Canadian Football League (CFL), a rouge is a one-point score that is awarded for certain plays that involve the ball being kicked into the end zone. The rouge is uniquely Canadian!"],r),A.a(["The Canadian Tulip Festival in Ottawa features 100 tulip varieties with more than one million blooms over 14,000 m\xb2. The celebration is a symbol of friendship between Canada and the Netherlands, with 20,000 bulbs being gifted by the Netherlands each year."],r),A.a(["Canadians drink more than 1 billion glasses of Canadian wine every year. Because of our cold climate, Canada is the largest Icewine producer in the world."],r),A.a(["The Royal Canadian Mounted Police, or \u201cMounties,\u201d are known for their iconic uniforms that feature the iconic scarlet tunic called a red serge."],r),A.a(["The Prairie provinces of Alberta, Saskatchewan, and Manitoba are known for being the most rural parts of Canada. Much of the Prairies' population is descended from 19th century farmer-settlers. The percentage of Canadians living in rural areas has gone from 87% in 1851 to 17.8% in 2021."],r),A.a(["The Canadian Armed Forces has personnel deployed across Canada and around the world. Since 1947, Canadian troops have completed 72 international missions."],r),A.a(["The Juno Awards celebrate the best in Canadian music! Anne Murray has won the most Junos with 25 wins (52 nominations), followed by Bryan Adams (21 wins, 63 nominations) and Celine Dion (20 wins, 75 nominations)."],r),A.a(["Canada's best summer Olympic sport is athletics, which includes running, hurdles, long jump, high jump, decathlon and other track & field events. Canada has earned 66 medals in athletics since 1900, including 16 gold, 17 silver and 33 bronze."],r),A.a(["Canada\u2019s North is particularly well-known as being the fabled \u201cland of the midnight sun.\u201d Due to its proximity to the Arctic Circle, northern days can entail up to 24 straight hours of sunlight in the summer. Calgary is the sunniest of Canada's large cities, enjoying an average of 2,400 hours of bright sun each year, spread over 333 days."],r),A.a(["There are six time zones in Canada covering four and a half hours. From west to east these time zones are: Pacific, Mountain, Central, Eastern, Atlantic and Newfoundland. Canada's Sir Sandford Fleming developed the modern system of standard time and time zones, still in use today."],r),A.a(["Canada is home to the two longest freshwater beaches in the world: Wasaga Beach (14 km) on the Georgian Bay in Ontario and Sauble Beach (11 km) on the Bruce Peninsula, along the eastern shore of Lake Huron."],r),A.a(["Approximately 275 Canadian ski areas see more than 19 million visits per season. Canadian skiers and snowboarders (an estimated number of 2.5 million) are on the slopes and trails an average of 7.5 days per year."],r),A.a(["The Ceremonial Guard is an ad hoc military unit in the Canadian Armed Forces that performs the Changing the Guard ceremony on Parliament Hill and posts sentries at Rideau Hall. We stand on guard for thee!"],r),A.a(["The Montreal Expos, named after the Expo 67 World's Fair, were the first Major League Baseball franchise located outside the USA, competing from 1969 until 2004. The last World's Fair held in Canada was Expo 86 in Vancouver."],r),A.a(["Waterpower is Canada's most abundant source of clean and renewable electricity, providing more than 60% of Canada's total electricity today. Canada is the fourth largest generator of hydroelectricity in the world."],r),A.a(["The ","Trans Canada Trail"," is Canada's national trail and is the longest network of multi-use recreational trails in the world. Crossing Canada on the Trans Canada Trail by foot would take over two years, spanning a whopping 24,134 km!"],r),A.a(["With roughly 22 different species of duck found in Canada, the most common is the Mallard. Saskatchewan is renowned for having some of the most abundant and productive waterfowl habitat in North America. Check out ","Ducks Unlimited Canada"," and how they are working to conserve, restore and manage Canadian wetlands."],r),A.a(["With around 80,423 cubic metres per capita, Canada has about 9% of the world's total renewable fresh water supply. When glacier, underground and lake water is included, Canada actually has 20% of the world's fresh water supply."],r),A.a(["Rain boots, winter boots, cowboy boots, hiking boots, ski/snowboard/snowmobile boots - there is no shortage of boots for Canadians to wear! DYK: The brown leather riding boots worn by the RCMP need to be shined for a minimum of 25 hours before they have the appropriate sheen to them!"],r),A.a(["A butter tart is a delicious pastry tart, which generally consists of butter, sugar, syrup, and egg, filled into a flaky pastry. The earliest published recipe for a butter tart is from Barrie, Ontario dating back to 1900 in the Women's Auxiliary of the Royal Victoria Hospital Cookbook."],r),A.a(["The McIntosh (nicknamed the \u201cMac\u201d) is the national apple of Canada. John McIntosh discovered the original McIntosh sapling on his Dundela farm in Upper Canada in 1811. Many years later, Apple Inc. named the Macintosh computer line after the fruit."],r),A.a(["Invented by Canadian James Naismith in 1891 while he was teaching at the YMCA in Springfield, Massachusetts, basketball is now one of the most popular sports in the world. The first game used a soccer ball and peach baskets as hoops, which gave the sport its name. Basketball was born!"],r),A.a(["The taiga or boreal forest has been called the world's largest land biome. In North America the taiga occupies much of Canada and Alaska. At 1.3 billion acres, the Canadian Boreal Forest is one of the largest intact forest and wetland ecosystems remaining on earth."],r),A.a(["Steel plays an extremely important role in the Canadian economy as a whole: in 2019, the Canadian steel industry contributed $4.2 billion to Canada's GDP. According to the Canadian Steel Producers Association, the Canadian steel industry employs, directly and indirectly, more than 120,000 Canadians."],r),A.a(["The Canada Games is a multi-sport event held every two years, alternating between the Canada Winter Games and the Canada Summer Games. They represent the highest level of national competition for Canadian athletes. The ","Niagara 2022 Canada Summer Games"," will take place Aug 6-21, 2022!"],r),A.a(["Canada is a representative democracy. During an election, all Canadian citizens who are at least 18 years old on election day can vote in their electoral district."],r),A.a(["One of the most widely-known facts about Canada is that we've got an abundance of trees, but did you know that Canada actually boasts 30 per cent of the world\u2019s boreal forest and 10 per cent of the world\u2019s total forest cover?"],r),A.a(["There are so many different types of fields in Canada: sports fields, wheat fields, oil fields, and ice fields to name a few. The Canadian Prairies are known for their open skies and vast fields of grain, but Canada is also home to the world's largest non-polar ice field in the St. Elias Mountains located in Kluane National Park and Reserve, Yukon Territory."],r),A.a(["The Prime Minister (PM) is the head of the federal government in Canada. It is the most powerful position in Canadian politics. While the Queen may be Canada's head of state, and the Governor General the Queen's representative, it's the Prime Minister who is known as the nation's head of government."],r),A.a(["Canadians love their potato chips! In 2020, the Canadian potato chips market had total revenues of almost $2 billion. Canada is also home to some truly Canadian original flavours - both Ketchup and All Dressed chips are almost exclusively available in Canada!"],r),A.a(["The telephone pager was invented in 1949 by Canadian Alfred J. Gross, a Toronto-based wireless communications pioneer. The devices Alfred invented also led to cordless and cellular telephone technology."],r),A.a(["Canada has the most donut shops and consumes the most donuts per capita of any other country in the world - around 1 billion annually! The donut-eating capital of Canada is Lloydminster, Alberta/Saskatchewan. National Donut Day was last Friday, June 3rd - we hope you celebrated with your favourite donut!\n\nIn Canada, the preferred spelling is \u201cdoughnut\u201d, but most dictionaries list \u201cdonut\u201d as an acceptable variant. We wanted to include it in the game since the doughnut/donut is considered by some as Canada's unofficial national sugary snack! \ud83c\udf69\ud83c\udf41"],r),A.a(["In 1907, Canadian Peter L. Robertson invented a square socket-head screw. He produced his screws in his Milton, Ontario, factory starting in 1908. At that time, it was a revolutionary change in the fastener industry. Robertson screws and screwdrivers carry his name to this day."],r),A.a(["In many Indigenous cultures in Canada, chiefs are the leaders of bands, clans and/or First Nations. Chiefs act as cultural and spiritual leaders and also serve as links between their people and the municipal, provincial and federal governments. RoseAnne Archibald is the current National Chief of the Assembly of First Nations (AFN) in Canada."],r),A.a(["Canada's Yukon Territory is home to 8 of Canada's tallest mountains, with Mount Logan topping them all at 5956m high. BC's Snow Dome peak is a unique \u201cthree-ocean peak\u201d, where if you poured a cup of water at the summit, the water could flow into the Pacific Ocean to the west, the Arctic Ocean to the north, or the Atlantic Ocean to the east."],r),A.a(["The largest indoor arena in Canada is the Montreal Canadiens' Bell Centre with a capacity of 21,700. The largest open air stadium is Edmonton's Commonwealth Stadium, home to CFL\u2019s Edmonton Elks, able to hold 56,302."],r),A.a(["\u201cToboggan\u201d is from the Mi'kmaq word \u201ctobakun,\u201d which means sled. In fact, the Inuit made the first toboggans out of whale bone and used it to transport people and belongings across the snowy tundra. Guy Martin holds the world record for fastest speed on a gravity powered snow sled at over 134 km/h in 2014!"],r),A.a(["The House of Commons of Canada is a democratically elected body whose members are known as members of Parliament (MPs). It is the lower house of the Parliament of Canada (the Senate is the upper house) and provides a link between Canadians and their Parliament. Many laws in Canada first begin as bills in the House of Commons."],r),A.a(["The Montr\xe9al bagel is one of Canada's most iconic and coveted snacks. It is a distinctive variety of handmade bagel that traditionally has a prounounced sweet taste and a chewy and dense texture, and is always baked in a wood-fired oven. The bagel first arrived in Montr\xe9al with the wave of Jewish immigrants from Eastern Europe in the early 1900s."],r),A.a(["The Canadian Armed Forces is the unified military of Canada, including sea, land, and air elements referred to as the Royal Canadian Navy, Canadian Army, and Royal Canadian Air Force. June 5th was Canadian Armed Forces Day - a day to honour and recognize members of the Canadian Armed Forces who display unwavering courage, sacrifice, and selflessness every day they wear the uniform."],r),A.a(["A total of 43 Olympic medals (including 10 gold medals) have been won by Canadian rowers, making rowing Canada's third-most successful summer Olympic sport (behind athletics and swimming)."],r),A.a(["Canadian inventor Reginald A. Fessenden is best known for his pioneering work developing radio technology, including the foundations of amplitude modulation (AM) radio. On 23 December 1900, he was the first person to send audio (wireless telephony) by means of electromagnetic waves, successfully transmitting speech by radio over a distance of about a 1.6 kilometres."],r),A.a(["Canada officially uses the metric system of measurement, and litre is the standard spelling of the metric unit for liquid volume. Canadians purchase gasoline in litres, and also buy milk by the litre (in bags in parts of Ontario, Quebec, and the Maritimes!)."],r),A.a(["Canada is one of the oldest continuing monarchies in the world. The title \u201cRoyal\u201d is a sign of honour and distinction, and the granting of this distinction is a prerogative of the Sovereign. In Canada, we have the Royal Canadian Navy, the Royal Canadian Air Force, the Royal Canadian Regiment in the Canadian Army, the Royal Canadian Mounted Police, the Royal Canadian Legion, the Royal College of Physicians and Surgeons of Canada, and the Royal Architectural Institute of Canada. In Canada's legislative process, a bill can only become law once it has received royal assent."],r),A.a(["Beading has a very long artistic and cultural history among the Indigenous people in Canada. At least 8,000 years before Europeans came to Canada, First Nations people were using beads in elaborate designs and for trade. Today, you can find beautiful First Nations beadwork at powwows, First Nations arts stores and museums across Canada.\n\nJune 21st is National Indigenous Peoples Day. Take the opportunity to learn more about the cultural and linguistic diversity as well as the contributions of First Nations, Inuit and M\xe9tis Peoples."],r),A.a(["The first quartz clock was developed in 1927 by Canadian-born telecommunications engineer Warren Marrison. During the 1940s, time standard laboratories throughout the world switched from mechanical clocks to quartz, and the quartz revolution had begun thanks to Marrison."],r),A.a(["With freshwater lakes, rivers and streams covering almost 9% of the country's total area, Canada is a haven for anglers. Canada is home to many different species of trout, including steelhead, rainbow trout, lake trout, brown trout, cutthroat trout and brook trout. Approximately 25% of the world's lake trout lakes are found in the province of Ontario."],r),A.a(["Hockey and Canada are synonymous with each other, and the sport remains integral to the country's culture. Hockey sticks go back to the 1800s where sticks were hand carved from a single piece of wood.  The first commercial sticks were said to be created by the Mi'kmaq carvers in Nova Scotia and were made from birch and hornbeam trees."],r),A.a(["Alberta is home to the richest source of dinosaur fossils in the world! The town of Drumheller in the heart of the Canadian Badlands is known as the \u201cDinosaur Capital of the World\u201d and boasts the world's largest dinosaur, a T-Rex standing 25m tall. Just down the road in the Red Deer River valley you'll find Dinosaur Provincial Park, a UNESCO World Heritage site where 58 unique dinosaur species have been discovered."],r),A.a(["Canada is as tall as it is wide, creating a wide range of climate conditions. From blistering cold winters to hot muggy summers; torrential rain, blinding snowstorms, deadly tornadoes and scorching drought, Canadians experience some of the planet's most diverse weather systems. Windsor, Ontario is the thunderstorm capital of Canada and has more lightning strikes than any other major city across the country."],r),A.a(["Pizza is one of the most popular foods in the world, and Canada is no exception. There is even \u201cCanadian pizza\u201d which typically includes tomato sauce, mozzarella cheese, bacon, pepperoni, and mushrooms. The country's biggest claim to pizza fame, however, is that the Hawaiian pizza was invented in Canada in 1962 by Sam Panopoulos, a native of Greece who was running a pizzeria in Chatham, Ontario. Pineapple pizza fans unite! \ud83c\udf4d\ud83e\udd53\ud83c\udf55"],r),A.a(["Maple taffy (tire d'\xe9rable or tire sur la neige in French-speaking Canada) is a sugar candy made by boiling maple sap past the point where it would form maple syrup, but not so long that it becomes maple butter or maple sugar. It is part of traditional culture in Qu\xe9bec, Eastern Ontario, New Brunswick, and Nova Scotia. In these regions, maple syrup is boiled, poured into rows on a snow-lined tray, and rolled onto sticks to make this chewy, irresistible candy."],r),A.a(['Although it is unknown who coined the term "Great White North" in reference to Canada, the nickname has been in use for many decades. \u201cGreat\u201d because it\'s the second largest country in the world. \u201cWhite\u201d because of the amount of Arctic frozen tundra and snow within the country. Finally, \u201cNorth\u201d because not only does Canada take up most of the northern half of North America, it also stretches nearly to the North Pole! Canada is also home to the Great Lakes, the largest group of freshwater lakes on Earth, as well as Great Bear Lake and Great Slave Lake in the Northwest Territories.'],r),A.a(["According to legend, the first hockey pucks used in early outdoor hockey games were pieces of frozen cow dung. Other early versions were made out of wood cut from the branches of trees. Sometimes even stones would suffice. Around 1875, rubber lacrosse balls were sliced in thirds and only the middle section was kept. Eventually, vulcanized rubber became the standard material used for hockey pucks."],r),A.a(["There is little doubt that Canada is one of the best places to live in the world, and there is a lot to be proud of in this amazing country! A few of the things that make us proud to call the Great White North home: universal health care, a rich ethnic diversity & inclusive culture, gorgeous scenery & landscapes, extraordinary wildlife, delicious food like poutine, butter tarts and maple syrup, real beer, and of course Canada's game, hockey! We feel a deep sense of pride towards this beautiful land and its inhabitants, and can proudly wear the maple leaf wherever we go. True north strong and free! \ud83c\udf41"],r),A.a(["The Last Spike was the final and ceremonial railway spike driven into the Canadian Pacific Railway (CPR) track by company director Donald Smith on the morning of 7 November 1885. Contemporaries and historians have viewed the Last Spike as a moment when national unity was realized."],r),A.a(["The Battle of Vimy Ridge, during the First World War, is Canada's most celebrated military victory \u2014 an often mythologized symbol of the birth of Canadian national pride and awareness."],r),A.a(['Although Canada has no official bird, the Canada Goose has long been a part of the national identity. Canada Geese are well known for flying in a distinctive V-shaped formation, their loud "honk" and their unmistakable looks.'],r),A.a(["The reign of Canada's new monarch, King Charles III, began when Queen Elizabeth II died on September 8. Queen Elizabeth II was Canada's monarch for over 70 years, making her the longest reigning monarch in Commonwealth history."],r),A.a(["In Canadian history, Upper Canada (also called Canada West) was the region in Canada now known as Ontario. You can travel back in time to one of Canada's largest living-history sites and experience life in the 1860s at ","Upper Canada Village"," near Morrisburg, Ontario."],r),A.a(["In geography, a plain is a flat expanse of land that generally does not change much in elevation.  The Canadian portion of the Great Plains is found in the Prairie Provinces, namely Alberta, Saskatchewan, and Manitoba."],r),A.a(['People from around the world refer to Canadian Money as "rainbow money" or "Monopoly money" thanks to its bright colours and unique artwork.'],r),A.a(["With the longest shoreline of all of the Great Lakes, Lake Huron is one of the most unique lakes on Earth. It is the second largest of the Great Lakes, and the fourth largest lake in the world by surface area. The Huron Wendat are an Iroquoian-speaking nation in Canada, originally living along the St. Lawrence River and between Lake Huron and Lake Ontario."],r),A.a(["The top selling style of beer in Canada is, by far, the pale lager. December 10th is National Lager Day in Canada!"],r),A.a(["Canada is home to some famous domes, including Calgary's unmistakeable Saddledome, the SkyDome in Toronto, the Montreal Biodome, and BC's Snow Dome peak which is a \"","hydrological apex",'" (a single point where three different watersheds meet).'],r),A.a(["A spile is a tube mechanism that you tap into a tree to collect sap, which in turn can be evaporated and boiled for delicious maple syrup!"],r),A.a(["Did you know that Ganong candy company in St. Stephen, New Brunswick is Canada's oldest chocolate and candy company? Canada is also home to some unique sweet candy treats, like Smarties, Coffee Crisp, Caramilk, Aero, Crunchie, and Mackintosh's Toffee to name a few!"],r),A.a(["Canada officially uses the metric system of measurement, and tonne is the standard spelling of the metric unit for weight. One tonne is equal to 1000kg, or the size of a fully grown bison!"],r),A.a(["Canada is home to some stunning rock formations, including New Brunswick's Hopewell Rocks, Ontario's Flowerpot Rocks, the Hoodoos found in Alberta's Badlands, Balancing Rock in Nova Scotia, and Rocher Perc\xe9 (Pierced Rock) in Quebec."],r),A.a(['Quilts were extremely important to the early settlers of Canada, since they had no good way of heating or insulating their homes, especially at night. The first quilts arrived in Canada with immigrants to "New France" in the early 1600s. Today, the ',"Canadian Quilters' Association"," celebrates quilting and Canadian quilters across the country."],r),A.a(["The Centennial Flame is a monument on Parliament Hill commemorating the 100th anniversary of the Canadian Confederation. It was first lit in January 1967 and burns atop a fountain that has a bronze shield with the coat of arms of a province or territory on each side."],r),A.a(["Larches are among the dominant plants in the boreal forests of Canada. Larches are the only Canadian deciduous conifers, turning golden and shedding all their leaves in fall."],r),A.a(["Having premiered on CBC in 2015, Schitt's Creek was Canada's best-kept sitcom secret. In its sixth and final season, the quirky and hilarious Canadian comedy Schitt's Creek pulled off a sweep, taking home seven primetime awards and nine Emmys in all."],r),A.a(["On the Pacific west coast, the Johnstone Strait, between Vancouver Island and the British Columbian mainland, is one of the best places in the world to see orcas. From late June to October this spot is home to nearly 300 of these majestic, playful creatures."],r),A.a(["The Group of Seven was a group of painters from 1920 to 1933, best known for their paintings inspired by the Canadian landscape that initiated the first major Canadian national art movement."],r),A.a(["Canadian citizens who are at least 18 years old on election day can vote in their electoral district in municipal, provincial/territorial, and federal elections. Did you know that on the day of a federal election, ","Elections Canada"," becomes the largest employer in the country? The agency hires about 250,000 people in communities across Canada."],r),A.a(["Canada is home to numerous basins, including Canada Basin in the Arctic, Basin Head Beach in Prince Edward Island, the Sudbury Basin in Ontario, and the Western Canada Sedimentary Basin which underlies 1.4 million square kilometres across Manitoba, Saskatchewan, Alberta, and British Columbia."],r),A.a(["The only fortified city north of Mexico, one cannot visit Qu\xe9bec City without admiring the fortified walls and ramparts which were the city's defensive system built between 1608 and 1871."],r),A.a(["Aviation is an integral part of the Canadian economy. In 2018, the air transport industry, including airlines, and its supply chain, supported over $50 billion of GDP in Canada."],r),A.a(["You can't have Canada's national dish without gravy! Poutine (aka \"Canadian Salad\") is the quintessential Canadian snack of fries and cheese curds covered in gravy."],r),A.a(['Pingos are impressive ice-cored hills found in the Arctic and Subarctic. "Pingo" is Inuvialuit for small hill. The Mackenzie Delta in the Northwest Territories has the highest concentration of pingos on Earth, approximately 1,350 of them. Pingos can be as big as a football stadium, up to 70 metres tall, with a circumference exceeding half a kilometre.'],r),A.a(["In Canada, law-making is one of the most significant responsibilities of Parliament. A bill is a proposed law that is introduced in either the House of Commons or the Senate. A bill can become law only once the same text has been approved by both Houses of Parliament and has received royal assent."],r),A.a(["The raven is of high importance to Indigenous Peoples throughout Canada, appearing in myths, legends, art and traditions. It is particularly important to Aboriginal people of the British Columbia coast, where it symbolizes creation, knowledge and prestige. The raven was adopted as the Yukon's official bird in 1985."],r),A.a(["Canada's neuroscience and mental health researchers are among the most productive and influential in the world. Canada is among the world's five most active countries in neuroscience. Canadian researchers have contributed to major scientific advancements in brain research that have furthered the field both nationally and internationally. ","Brain Canada"," plays an invaluable, critical role in this success."],r),A.a(["Point Pelee is the southernmost point of mainland Canada, and is an important rest stop for migrating birds. ","Point Pelee National Park"," is Canada's second smallest but most ecologically diverse national park, and is home to more than 390 bird species and 70 species of trees, some of which are species at risk."],r),A.a(["A roper is a person who uses a lasso to catch an animal, especially in a rodeo. The Calgary Stampede features the best riders, racers and ropers each year!"],r),A.a(["Seals are found in the waters of all three Canadian oceans: harbour in both Pacific and Atlantic; bearded and ringed in the Arctic; harp and hooded in the North Atlantic and parts of the Arctic; and grey in Atlantic Canada."],r),A.a(["The Royal Canadian Navy's (RCN) fleet is made up of numerous classes of ships, submarines and other support vessels, as well as specialized units that allow Canada to maintain one of the most active blue-water navies in the world. The Royal Canadian Air Force (RCAF) aircraft fleet ranges from huge transport aircraft to helicopters to fighters to patrol aircraft and more. They are used to carry out a multitude of roles at home and abroad, in peace and in conflict, all in support of the RCAF's mission of providing relevant, responsive and effective air power to meet the defence challenges of today and into the future.\n\nNovember 5 to 11 is Veterans' Week, an opportunity for Canadians to honour the extraordinary efforts and sacrifices of our veterans. Thank you for your service!"],r),A.a(["Canada is the most educated country globally, with over 56% of adults meeting the OECD criteria of residents aged 25 to 64 who have completed some form of tertiary education."],r),A.a(["Stem cells were first discovered by Canadians Dr. James Till and Dr. Ernest McCulloch who were both pioneers in biomedical research. Stem cells can self-renew and can be artificially grown, leading to all kinds of possibilities for the cure of disease and the rebuilding of tissue. Till and McCulloch were jointly nominated and inducted into the Canadian Medical Hall of Fame."],r),A.a(["There are approx 1 million sheep in Canada on about 11,000 farms. The most popular breeds in Canada are the Suffolk, Dorset and Rideau Arcott. The Canadian Cooperative Wool Growers (CCWG) grades close to 1,400 tonnes of raw wool each year and sells most of it to the USA and the UK. "],r),A.a(["Canada has a storied piano making past, and was home to more than 100 piano manufacturing companies during the peak era of the industry. Piano building in Canada began in the early 19th century and grew into a major, thriving industry between 1890 and 1925.\n\nMany Canadians have become noted pianists. Glenn Gould is a bona fide Canadian icon who became one of the most famous and celebrated classical pianists of the 20th century, while Oscar Peterson has had an equally influential role in jazz piano and is considered one of the greatest jazz pianists of all time. Other notable Canadian pianists include Angela Hewitt, Chantal Kreviazuk, Diana Krall, Marc-Andr\xe9 Hamelin, Anton Kuerti, Charles Richard-Hamelin, and Jan Lisiecki."],r),A.a(["Canada is home to over 180 different ferry routes with a route presently operating in each province and the majority of the territories. Transportation through waterways has always been a crucial part of Canada\u2019s history.  From the First Nations traveling by canoes through rivers, lakes and parts of the oceans to the early explorers, there has always been an emphasis on the transportation of people by boats."],r),A.a(["For more than 100 years, millions of Canadians have proudly served our country in uniform. While the Canadian Armed Forces (CAF) are known to put their lives on the line to support international operations, they also fulfill important roles on home soil. They provide national and regional security, serve on search and rescue missions and respond to natural disasters. On this Remembrance Day, we honour those who made the ultimate sacrifice. Lest we forget."],r),A.a(["In Canada, 16 species of perch fish occur, including the yellow perch, the walleye and the sauger. The Canadian waters of Lake Erie are well known for producing monster jumbo perch."],r),A.a(["The Toronto Argonauts (colloquially known as the Argos) are a professional Canadian football team in the CFL. Founded in 1873, the team is the oldest existing professional sports team in North America still using its original name. The Argos have won the Grey Cup a record 17 times and have appeared in the final 23 times."],r),A.a(["In Canada, the history of cider could be traced back to explorers like Captain Cook and the Hudson's Bay Company. Cider was used to help prevent scurvy!  It may have been the British that first brought cider to Canada, but production flourished in Quebec."],r),A.a(["The Queen's Own Rifles of Canada is a Primary Army Reserve infantry regiment based in Toronto. Founded on April 26th, 1860, it is the oldest continuously serving infantry regiment in Canada. Its members have served in every Canadian military campaign and served with great distinction in World War I and World War II in which 7 Riflemen were awarded the Victoria Cross."],r),A.a(["Canada is the world's largest producer of mustard seed, most of it farmed in the southern prairie regions of Alberta and Saskatchewan. Canada is also the largest producer of flaxseed in the world, representing about 40% of world production."],r),A.a(["With the world's longest coastline and more than half the earth's area covered in lakes, Canada is home to more than 750 lighthouses. Lighthouses across Canada have long symbolized strength, safety and safe harbour. The first lighthouse in Canada was built in Louisbourg on Cape Breton Island, Nova Scotia, in 1734. Did you know that every lighthouse has a distinctive flash pattern?"],r),A.a(["Canada is a country that curls! According to ","Curling Canada",", there are 1,000 curling rinks across the country. Canada has won 12 medals since curling became an Olympic sport in 1998, the most most any country has won in curling at the Olympic Winter Games! Canada has also won a record 59 golds at the World Curling Championships across the men's, women's, mixed and wheelchair events. Hurry hard!"],r),A.a(["Canada is home to some impressive mountain peaks, but Mount Logan tops them all at 5956m high. It is part of the St. Elias Mountains in the Kluane National Park and Reserve, a UNESCO World Heritage Site. Canada's Yukon Territory is home to 8 of Canada's tallest mountains, including Mount Logan."],r),A.a(["Canada declared November 20th as ","National Child Day"," to celebrate the rights of children. It was chosen in recognition of Canada's commitment to upholding the rights of children, and to commemorate the day the United Nations adopted the United Nations Convention on the Rights of the Child (UNCRC) on November 20, 1989."],r),A.a(["Just for Laughs"," is a comedy festival held each July in Montreal, Quebec, Canada. Founded in 1983 at the Saint-Denis Theatre, it has grown to become the largest international comedy festival in the world. Hundreds of big-name comedians have participated, including Jim Carrey, Trevor Noah, Joan Rivers, Jimmy Fallon, Kevin Hart, and Amy Schumer.\n\nIt's ","Canada History Week",'! This year it takes place from November 21 to 27 and the theme is "Arts, Culture, and Creators".  The week encourages Canadians to reflect upon and engage with Canada\'s past, and serves as an opportunity for Canadian citizens to learn more about the people, places, and events that shaped the country they know today. Canuckle will be featuring words all week that tie in with the theme! #HistoryWeek2022'],r),A.a(["Canadian inventor and electrical engineer, Dr. Brent Townshend, created a core concept in 1996 that served as the basis for what is known as the 56K bit/sec modem, a groundbreaking technology at the time that allowed for data transfer between two computers at high speeds over standard analog dial-up phone line connections. 56K doesn't seem like much these days, but back in the mid-90s, it was a big step forward in Internet technology!"],r),A.a(["The film industry in Canada has grown so much over the years that it has been referred to as Hollywood North. Toronto is the home to the ","Toronto International Film Festival",", which is considered by many in the film industry to be second only to Cannes in terms of influence.\n\nJames Cameron, born in Kapuskasing, Ontario, is the writer and director of the two highest-grossing movies of all time, Avatar (2009) and Titanic (1997). The two films have combined to gross nearly $500 million dollars.\n\nSave the date: April 19, 2023 is ","National Canadian Film Day","!"],r),A.a(["It's a Bird... It's a Plane... It's Superman! The Superman character was co-created by Canadian artist Joseph Shuster. Born in Toronto, he is a cousin of Wayne Shuster, one-half of the beloved Canadian comedy duo Wayne and Shuster. Joseph, who passed away in 1992 at the age of 78, said Metropolis was modelled on Toronto and the Daily Planet was inspired by the Toronto Star, which he delivered as a kid."],r),A.a(["Canada is a country rich in multicultural heritage and culture, part of which is dance. Long before we called this land Canada, Aboriginal dancers were practising dance. Powwow dances are beautiful expressions of Indigenous spirituality, history and culture. When more people began immigrating to Canada in the 1900s, they brought with them bits of rich heritage and culture from all over the globe. This influx of international talent is what led to the creation of most of our dance institutions today, including the National Ballet of Canada and the Royal Winnipeg Ballet, Canada's oldest ballet company and the longest continuously operating ballet company in North America.\n\nSikh-Canadian Gurdeep Pandher of the Yukon, has been spreading joy, hope and positivity across Canada with his Bhangra dancing - a traditional folk dance of Punjab. Check out ","www.gurdeep.ca"," and get ready to dance!"],r),A.a(["Dr. Wilder Graves Penfield was one of Canada's foremost neurosurgeons. He had a desire to understand the cause of brain illnesses, and made groundbreaking advances in the treatment of seizure disorders. Penfield established the Montreal Neurological institute (the Neuro) in 1934, and along with his colleagues, developed the Montreal procedure for patients with severe epilepsy. The first patient to undergo the Montreal procedure reported smelling burnt toast, and this helped doctors to identify and destroy the nerve cells causing the seizures. Penfield\u2019s experiments with stimulating different parts of the brain helped us learn to map its different sensory areas. Check out this ","Heritage Minute video about Dr. Wilder Penfield"," to learn more!"],r),A.a(["Charles Fenerty was a Canadian inventor who invented the wood pulp process for papermaking, which was first adapted into the production of newsprint and later the modern paper we use today. Fenerty was born in Sackville, Nova Scotia and was also a well-known poet of his time, publishing more than 35 (known) poems."],r),A.a(["It is no secret that it rains a great deal in British Columbia. In fact, many of Canada's rainiest places are located in the province. Located on Vancouver Island, Hucuktlis Lake (pronounced \"who chook-tlis\"), formerly Henderson Lake, receives more rainfall throughout the year than any other place in North America. The soggy spot receives 7296 mm of precipitation annually. What's more, the area holds the record for the most rainfall in a year ever: a jaw-dropping 9,307 mm fell in 1997!"],r),A.a(["The Burgess Shale is a fossil-bearing deposit exposed in the Canadian Rockies of British Columbia, Canada. Found in Canada's Yoho National Park, it is one of the most important fossil sites in the world! The rocks here preserve not only the usual hard shells of ancient organisms, but also soft skin and tissue, allowing for stunning impressions of the strange creatures of 500 million years ago!"],r),A.a(["Alberta has become synonymous with choice cuts of AAA beef, and chowing down on a delicious and tender steak is at the top of most people's list when they first come to the province.  Beef produced in Alberta is recognized around the world for its rich taste, even fat distribution and consistent quality."],r),A.a(["The Centre Block is the main building of the Canadian parliamentary complex on Parliament Hill, in Ottawa, Ontario, containing the House of Commons and Senate chambers, as well as the offices of a number of members of parliament, senators, and senior administration for both legislative houses."],r),A.a(["Canada is home to both river otters and sea otters. While river otters can be found in every province and territory, sea otters are mainly found on Canada's west coast. Scientists consider the sea otter to be a keystone species - one that modifies and creates its habitat. When it was gone from Canadian waters, kelp forests declined because urchins and other animals that eat seaweed weren't controlled by the otter preying on them. With the return of the otter, kelp forests are in much better shape. This is important because healthy kelp forests provide habitat to fish and reduce coastal erosion by slowing water currents. Sea otters are also of some importance to West Coast Indigenous Peoples - they are depicted in their art and featured in their stories."],r),A.a(["Baffin Island, Canada is home to Mount Thor, the world's tallest vertical cliff. In fact, it's steeper than vertical, with a 105-degree overhang. Check out this ","article by Jeopardy champ Ken Jennings"," all about Mount Thor!"],r),A.a(['Known as the "Dinosaur Capital of the World", the town of Drumheller, Ablerta has some of the richest deposits of fossils and dinosaur bones in the world! In Alberta\'s Red Deer River valley, home to Dinosaur Provincial Park, more than 1,000 complete skeletons of extinct dinosaurs have been found since the late 1800s.'],r),A.a(["The first known dump truck was developed in Saint John, New Brunswick when Canadian Robert Mawhinney attached a dump box to a flatbed truck in 1920. His idea was an instant hit, and within a decade, the dump truck was mandatory equipment wherever earth was moved.\n\nCanuckle is part of a crossover game this week with World Wide Web Hunt! Try to solve the puzzle and crack the riddles at ",s,"! \ud83d\udd0e\ud83d\udd75\ufe0f\ud83d\uddfa\ufe0f"],r),A.a(["Historically, Indigenous peoples throughout most of Canada made and used snowshoes to travel on foot during the winter. Snowshoes enabled them to walk over knee-deep snow and to hunt without making much noise. Snowshoe sizes and styles differed according to local conditions: Inuit of the Far North relied on a more circular shoe to handle deep powder; Cree of the Prairies developed a longer and narrower version for the windswept plains; while Iroquois of the Canadian Shield depended on much shorter ones to manoeuvre in crowded forests."],r),A.a(["Canada's response to the threat of Soviet nuclear bombers was the Avro Arrow. A marvel of engineering, it was a twin-engine, all-weather supersonic interceptor. Only five Avro Arrow planes were ever built, yet this innovative jet fighter put Canada on top of the aviation world in the 1950s."],r),A.a(["Norman Breakey from Toronto created the first paint roller in 1939. Unfortunately, he didn't patent the innovation and knock-offs quickly emerged. He may not get the credit he deserves, but Norman's invention has aided generations of painters. Next time you are painting a wall or ceiling, take a moment to remember Canadian Norman Breakey!"],r),A.a(["Each spring along the eastern coast of Newfoundland and Labrador, it's prime time for spotting icebergs. With many little towns along a thousand kilometres of coastline, this area known as \"Iceberg Alley\" is an outstanding location for viewing roving blue natural ice sculptures that float down from Greenland and Canada's Arctic. The massive chunks of broken glaciers are only 10% visible since most of the iceberg is submerged and floating on its side."],r),A.a(["In the past decade, Canada has seen a rapidly growing number of craft breweries popping up. Craft breweries have become so popular in Canada that a new association, Canadian Craft Brewers Association, was formed in May 2019. Sales of craft beer increased tenfold from 2008 to 2018, and it now accounts for 6% of the Canadian market.\n\nDecember 10th is National Lager Day! Lagers are some of the most popular beer styles in the world and Canada is no exception. Celebrate with a craft lager from your favourite Canadian brewery!"],r),A.a(["Steam transportation allowed people in Canada to move beyond their immediate communities and interact with a wider world. The years from 1900 to 1960 were the last great age of steam locomotion. Steamships and steam-powered railways were at the height of their power, efficiency, and reliability. These technologies were fundamental to the lives of Canadians.\n\nToday is the last day to play the crossover game with World Wide Web Hunt! Be sure to check it out at ",s,"! \ud83d\udd0e\ud83d\udd75\ufe0f\ud83d\uddfa\ufe0f"],r),A.a(['Canada has some iconic coins, including the $1 loonie and the $2 toonie. DYK: In 2017, the Canadian Mint ran a contest and Canadians chose "Churchill" as the toonie polar bear\'s official name, a reference both to Winston Churchill and to the common polar bear sightings in Churchill, Manitoba. Canada has even commemorated the coins with monuments: the "Big Loonie" in Echo Bay, Ontario and the "Giant Toonie" in Campbellford, Ontario.'],r),A.a(["The west coast of Canada is one of the major fjord coastlines of the world, hosting about 150 inlets. The remote and rugged coastline of British Columbia is indented with stunning inlets that cut deep into the Coast Mountains of the BC mainland north of Vancouver. Inlets can be found across the country from coast to coast to coast!"],r),A.a(["The Forks, located in Winnipeg at the junction of the Red and Assiniboine rivers, has been a meeting place for over 6,000 years. Indigenous peoples traded at The Forks, followed by European fur traders, Scottish settlers, railway pioneers and tens of thousands of immigrants. The Forks was designated a National Historic Site of Canada in 1974 due to its status as a cultural landscape. The Canadian Museum for Human Rights is located on Indigenous ancestral lands just adjacent to The Forks."],r),A.a(["Although the bald eagle is the national bird of the United States, the town of Squamish, British Columbia is the bald eagle capital of the world! Thousands of bald eagles converge between December and March to feed on spawning salmon in the Squamish River. In Indigenous culture, it is believed that all things possess inherent power and wisdom, and the eagle is a powerful spiritual symbol signifying a connection with the Creator. The eagle is seen as a messenger of the Creator who imparts wisdom and medicine, so its feathers are sacred gifts to be used reverently in ceremonies, to honour people, show respect, or to purify and pray for blessings."],r),A.a(["With so many canals and waterways across the country, Canada is home to numerous locks to help watercraft navigate all the different levels of water. The Rideau Canal Locks in Ottawa are the oldest continuously operating canal system in North America. In use since 1832, these locks are still operated by hand today."],r),A.a(["The Canadian Constitution recognizes 3 groups of Indigenous peoples: First Nations, Inuit and M\xe9tis. These are 3 distinct peoples with unique histories, languages, cultural practices and spiritual beliefs. More than 1.67 million people in Canada identify themselves as an Aboriginal person, according to the 2016 Census. RoseAnne Archibald is a Canadian First Nations advocate and politician who is the current National Chief of the Assembly of First Nations since July 8, 2021. She is the first female National Chief of the Assembly of First Nations."],r),A.a(["As the 2022 FIFA Men's World Cup wraps up in Qatar, we are reflecting on the time that the Canada Men's National Soccer team spent on the pitch proudly representing our country. After Canada's 36-year-long wait to return to the men's FIFA World Cup, they inspired fans from coast to coast to coast with their performance. The Canada Women's National Soccer team's success on the pitch includes 3 straight Olympic medals, including gold in 2020! They'll be competing in the ","2023 FIFA Women's World Cup"," in Australia and New Zealand so get ready to cheer them on! #WeCAN"],r),A.a(["Crude oil is one of Canada's top exports by value and it is a versatile source of Canadian energy that will be a part of the global energy mix for decades to come. There are thousands of active oil and gas wells across the country. The First Oil Well in Western Canada, also known as Lineham Discovery Well No. 1, is now a defunct oil well and national historic site of Canada. The oil well originally drilled in 1902, was the first productive oil well in the Western Canadian provinces."],r),A.a(["The world's tallest mural"," can be found in downtown Calgary, Alberta! It was completed in the summer of 2022 by internationally renowned graffiti artist Mirko Reisser (known as DAIM) and stands 95 metres high on the side of a building across the train tracks from the Calgary Tower. It took 130 litres of paint primer, 207 litres of base coat paint and 543 cans of spray paint."],r),A.a(["The Canadian Corps was a World War I corps formed from the Canadian Expeditionary Force in September 1915. The Canadian Corps captured Vimy Ridge in April 1917 in a daring attack that was a turning point in the war. This corps earned an enviable record in battle and represented the first authentic expression of Canada in the world; its strength and reputation meant that Canada could not be treated as a mere colony."],r),A.a(["Winter is officially here! The scarf is an essential item of clothing for the winter season in Canada. It's all about layers if you want to be comfortable in the cold weather, and the scarf is one of the best winter accessories for staying warm.\n\nThe Kokom (Kokum) Scarf or Ukrainian Scarf are a symbol of relations of the Indigenous peoples supporting Ukrainian settlers that arrived to Canada. These scarves were traded among Indigenous and Ukrainian women. There are many similarities between the two cultures and the scarf today resembles unity and respect for each other."],r),A.a(['In 2001, Canada took the lead to promote an international standard for wind chill. A team of scientists and medical experts from Canada and the US worked together to develop the current wind chill index. This index represents the degree of "chill" that your skin senses, and is based on the loss of heat from the face. Wind chills below -70 have been recorded in northern communities in Canada. On January 13, 1975 at Kugaaruk, Nunavut, the air temperature was -51C and the winds were 56km/h, producing a bone-chilling wind chill of -78!'],r),A.a(["R\xe9veillon is a traditional all-night feast that starts after church service on Christmas Eve and lasts until the wee hours of Christmas morning. First celebrated in 19th-century France, the Canadian menu includes tourti\xe8re (a meat pie made with pork and beef or veal), rago\xfbt de pattes de cochon (pigs' feet stew) and b\xfbche de N\xf6el (a Yule log dessert). This celebration and the traditions and foods associated with it speak to the history of francophones across Canada."],r),A.a(["Merry Christmas from Canuckle! The Scotch pine reigns as the top Christmas tree in Canada. Scotch pines hardly shed any of their long needles, and their strong, curved branches also hold ornaments well. Canada exported over 2.4 million fresh Christmas trees to countries all over the world in 2021! Pines are the also the arboreal emblem of the provinces of Alberta (Lodgepole pine) and Ontario (Eastern white pine)."],r),A.a(["If you take in a movie over the holidays, you can thank Montreal-born L\xe9o-Ernest Ouimet for the magic of the movie theatre. In 1906, he opened his first movie house, the Ouimetoscope, on Saint Catherine Street. In 1907, Ouimet expanded the Ouimetoscope to house the first luxury projection room in North America, making it the world's first and largest cinema theatre to open exclusively for movies!"],r),A.a(["As part of the British effort to combat German U-boats in 1917, Canadian physicist Robert William Boyle combined transducers made with quartz with amplifiers developed by French researchers to create the world's first high-frequency echolocation device: SONAR. Originally an acronym for SOund Navigation And Ranging, sonar is a technique that uses sound to navigate, communicate with or detect objects on or under the surface of the water. Boyle's work on sonar was built upon the work of another Canadian-born inventor, Reginald Fessenden, who is best known for his pioneering work developing radio technology."],r),A.a(['The Edmonton Grads were a powerhouse women\'s basketball team. The Edmonton Commercial Graduates Basketball Club, better known as \u201cThe Grads,\u201d started as a high school girls basketball team and became a sports dynasty. World Champions for 17 years, the Grads dominated regionally, nationally, and internationally for 25 years beginning in 1915. Their record of 502 wins and only 20 losses is unmatched in all of sport. Dr. James Naismith called them "the finest team to ever step out onto a floor." Check out the ',"Heritage Minutes video"," celebrating the Edmonton Grads."],r),A.a(["Cairns are stone landmarks that are used as a point of reference for navigation and as a marker for travel routes. In Canada, these rock piles are often called \u201cinukshuks\u201d as many try to replicate the Inuit (and other Arctic peoples') cairns shaped like people and commonly known by that name."],r),A.a(["Canada is home to some incredible mountain ranges, including the famous Rocky Mountains. The Canadian Rockies house over 50 high mountains whose elevation exceeds the 11,000 ft (3,350 m) mark. The highest peak of this range of mountains is Mount Robson, which stands at 12,972 ft (3,954 m) above mean sea level."],r),A.a(["It's time to ring in the New Year! Churches, cathedrals and towers across Canada will be ringing the bells tonight at midnight to signal the start of 2023. There are 11 carillons in Canada, ranging from the historic Hamilton cathedral to the more modern Exhibition Place carillon in Toronto. The Peace Tower Carillon on Parliament Hill in Ottawa is the most frequently played and the best known carillon. It has 53 bells, and was inaugurated on July 1, 1927 to mark the 60th anniversary of Confederation. The Cathedral of the Transfiguration in Markham, Ontario contains one of the world\u2019s largest sets of bells. They were cast in bronze and weigh in at a whopping 32,000 pounds (over 14,500kg)!"],r)],t.rj)}()
